body {
	background-color: #251e28;
	text-align: center;
}

.DiveInButton {
	-webkit-transition-timing-function: ease-in;
	     -o-transition-timing-function: ease-in;
	        transition-timing-function: ease-in;
	/* position: absolute;
	top:45%;
	left:41.5%;
	right:41.5%;
	bottom:45%; */
	font-family: 'Oswald', sans-serif;
	font-size: 2em;
	border:3px solid #61A8D6;
	color:#61A8D6;
	background-color: #251e28;
	width: 17%;
	height: 20%;
	-webkit-transition: 1s all;
	-o-transition: 1s all;
	transition: 1s all;
}
.DiveInButton:hover {
	border:3px solid #61A8D6;
	background-color: #61A8D6;
	color:#251e28;
}
.DiveInButton div{
	-webkit-transform: scale(1);
	    -ms-transform: scale(1);
	        transform: scale(1);
	-webkit-transition: 1s -webkit-transform;
	transition: 1s -webkit-transform;
	-o-transition: 1s transform;
	transition: 1s transform;
	transition: 1s transform, 1s -webkit-transform;
}
.DiveInButton:hover div{
	-webkit-transform: scale(1.05);
	    -ms-transform: scale(1.05);
	        transform: scale(1.05);
	-webkit-transition: 1s -webkit-transform;
	transition: 1s -webkit-transform;
	-o-transition: 1s transform;
	transition: 1s transform;
	transition: 1s transform, 1s -webkit-transform;
}
/* Styling for Navbar */
nav {
	color: white;
	font-size: 1.2rem;
}
nav ul {
	list-style-type: none;
	margin: 0;
	padding: 0;
	display: flex;
	max-width:  90%;
	padding-left: 5%;
	padding-right: 5%;
}
nav ul a {
	-webkit-transition-timing-function: ease-in;
	     -o-transition-timing-function: ease-in;
	        transition-timing-function: ease-in;
	-webkit-transition: 0.25s all;
	-o-transition: 0.25s all;
	transition: 0.25s all;
	padding: 0.5rem;
	text-align: center;
	margin-left: auto;
	margin-right: auto;
	padding-left: 0;
	padding-right: 0;
	flex-grow: 1;
  flex-basis: 0;
}
a.main {
	border-bottom:6px solid #FFD300;
	text-transform: uppercase;
}
nav ul a:hover {
	-webkit-transition-timing-function: ease-out;
	     -o-transition-timing-function: ease-out;
	        transition-timing-function: ease-out;
	border-bottom:6px solid #61A8D6;
}
.burger {
	display: none;
}
.burger div{
	width: 25px;
	height: 3px;
	background-color: white;
	margin: 5px;
}
.responsive {
	background-color: white;
	display: none;
}

/* Styling for Navbar ends here */
.username-form {
	color: white;
}
.username-button {
	margin-top: 20px;
}
.loader {
  border: 7px solid #3a343d; /* Light grey */
  border-top: 7px solid #61A8D6; /* Blue */
  border-radius: 50%;
  width: 60px;
  height: 60px;
  text-align: center;
  margin: 24% auto;
  animation: spin 2s linear infinite;
}
@keyframes spin {
  0% { transform: rotate(0deg); }
  100% { transform: rotate(360deg); }
}
.rules {
	color: white;
}
/* Jumbotron CSS Rules */
.main-image {
	width: 500px;
	height: 500px;
	float: right;
}
.jumbotron {
	font-family: 'Montserrat', sans-serif;
	text-align: left;
	margin: 100px 100px ;
}
.jumbotron-heading {
	padding-top: 120px;
	color: white;
	font-size: 50px;
	text-transform: uppercase;
	letter-spacing: 5px;
	margin-bottom: 10px;
}
.jumbotron-subtitle {
	color: white;
	font-size: 25px;
	margin-top: 0px;
}
.level-image {
	max-width: 75%;
	max-height: 75%;
}

.leaderboard {
	font-family: Title;
	text-align: center;
	margin-left: auto;
	margin-right: auto;
	color: white;
	font-size: 1.2rem;
	border-collapse: collapse;
}
.leaderboard td {
	border: 0.3px solid gray;
	padding: 15px;
	padding-top: 6px;
	padding-bottom: 6px;
}
a {
	text-decoration: none;
	color: white;
}
.white-text {
	color: white;
}
.won {
	position: absolute;
		left: 50%;
		top: 50%;
		-webkit-transform: translate(-50%, -50%);
		transform: translate(-50%, -50%);
}
.congrats {
	color: white;
	font-size: 41px;
}
